import React from "react";
import Newsapp from "./Components/Newsapp/Newsapp";
import Navbar from "./Components/Navbar/Navbar";
import { Route, Routes } from "react-router-dom";

const App = () => {
  return (
    <>
      <Navbar />
      <Routes>
        <Route exact path="/Apple">
          <Newsapp newsName="iphone" />
        </Route>
        <Route path="/Tesla">
          <Newsapp newsName="tesla" />
        </Route>
        <Route path="/Bitcoin">
          <Newsapp newsName="bitcoin" />
        </Route>
        <Route path="/nasa">
          <Newsapp newsName="nasa" />
        </Route>
        <Route path="/upsc">
          <Newsapp newsName="upsc" />
        </Route>
      </Routes>
    </>

  );
};

export default App;
